// src/App.js

import React from 'react';
import { BrowserRouter as Router, Route, Link } from 'react-router-dom';

const travelBlogs = [
  { id: 1, title: '〇〇旅行', content: '〇〇旅行の内容や写真など' },
  { id: 2, title: '××旅行', content: '××旅行の内容や写真など' }
];

const TravelListPage = () => (
  <div>
    <h1>旅行ブログ一覧</h1>
    <ul>
      {travelBlogs.map(blog => (
        <li key={blog.id}>
          <Link to={`/travel/${blog.id}`}>{blog.title}</Link>
        </li>
      ))}
    </ul>
  </div>
);

const TravelBlogPage = ({ match }) => {
  const blogId = parseInt(match.params.blogId);
  const blog = travelBlogs.find(blog => blog.id === blogId);

  return (
    <div>
      <h2>{blog.title}</h2>
      <p>{blog.content}</p>
    </div>
  );
};

const App = () => (
  <Router>
    <div>aaaa</div>
    {/* <div>
      // <Route exact path="/" component={TravelListPage} />
      <Route path="/travel/:blogId" component={TravelBlogPage} />
    </div> */}
  </Router>
);

export default App;
